import React from "react";

const Biographie = () => {
    return (
        <div id="biographieID" className="Biographie modules">
            <div>
                <img src="https://www.radiofrance.fr/s3/cruiser-production/2022/01/085f9b8d-ac23-4a47-9875-e42e204c4ac8/870x489_zemmour_ok_ok.jpg" />
            </div>
            <h4>
                Je m’appelle Damien Claret, je suis un jeune garçon de 14 ans,
                je suis en 3éme et à la recherche d’un stage. J’habite en
                bretagne dans le Morbihan. j’ai toujours été très curieux et
                motivé, ce qui m'a ammener a me lancer dans l'apprentissage du
                développement web. J'ai commencé par apprendre JavaScipt, HTML
                et pour finir CSS. J'ai continué l'apprentissage de nouvelles
                technologie notamment avec Node.js et la librairie React.js.
            </h4>
        </div>
    );
};

export default Biographie;
